import React from 'react';
import { Link } from 'react-router-dom';


const AccountNavBarComponent = ({ state, account }) => (
  <>
    <li><Link to="/login/" style={{ display: (state.state==='default') ? 'block' : 'none'}} >Log In</Link></li>
    <li><Link to="/register/" style={{ display: (state.state==='default') ? 'block' : 'none'}}>Register</Link></li>
    <li><Link to="/logout/" style={{ display: (state.state==='loggedIn') ? 'block' : 'none'}}>Logout from {account}</Link></li>
  </>
)

export default AccountNavBarComponent;
